import React from "react";
import "./PlatfromOrgChart.scss";
import { PlatformBarometer } from '../Platform-barometer/PlatformBarometer'

export class PlatfromOrgChart extends React.Component {
  render() {
    return (
      <>
        <div className="org-chart"></div>
        <div className="charts">
          <PlatformBarometer />
        </div>
      </>
    );
  }
}
